import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './components/app/app';
import reportWebVitals from './reportWebVitals';


const BOOK_NAME = ['Замуж за коня', 'Хозяин проклятого поместья', 'Месть Анны-Луизы'];
const booksData = [
  {
    title: 'Замуж за коня',
    tags: 'властный герой, дерзкая героиня, муж и жена',
    price: 109,
    description: 'Знаете, как быстро выйти замуж? Разозлите отца, будьте откровенны с мачехой, откажите всем приличным женихам в городе и потеряйте волю, когда вам предложат немыслим...'
  },
  {},
];

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App 
       bookName={BOOK_NAME}/>,
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
